function Navmenu() {
    return (
        <div className="text-light d-table-cell" >
            <nav className="navbar navbar-dark align-items-start sidebar sidebar-dark accordion bg-gradient-primary p-0">
                <div className="container-fluid d-flex flex-column p-0">
                    <hr className="sidebar-divider my-0"></hr>
                        <ul className="navbar-nav text-light" id="accordionSidebar">
                            <li className="nav-item"><a className="nav-link active" href={""}><i
                                className="fas fa-shopping-cart"></i><span>Заказ</span></a></li>
                            <li className="nav-item"><a className="nav-link" href={""}><i
                                className="far fa-edit"></i><span>Редактор заказов</span></a></li>
                        </ul>
                </div>
            </nav>
        </div>
    );
}

export default Navmenu;
